o as entradas por devolução simbólica de mercadorias vendidas ou utilizadas em processo industrial, remetidas anteriormente a título de consignação mercantil ou industrial.', "2000-01-01T00:00:01.0000000"),(231, 2920, 'Entrada de vasilhame ou sacaria', 'Classificam-se neste código as entradas de vasilhame ou sacaria.', "2000-01-01T00:00:01.0000000"),(232, 2921, 'Retorno de vasilhame ou sacaria', 'Classificam-se neste código as entradas em retorno de vasilhame ou sacaria.', "2000-01-01T00:00:01.0000000"),(233, 2922, 'Lançamento efetuado a título de simples faturamento decorrente de compra p/ recebimento futuro', 'Classificam-se neste código os registros efetuados a título de simples faturamento decorrente de compra para recebimento futuro.', "2000-01-01T00:00:01.0000000"),(234, 2923, 'Entrada de mercadoria recebida do vendedor remetente, em venda à ordem', 'Classificam-se neste código as entradas de mercadorias recebidas do vendedor remetente, em vendas à ordem, cuja compra do adquirente originário, foi classificada nos códigos 2.120 - Compra para industrialização, em venda à ordem, já recebida do vende', "2000-01-01T00:00:01.0000000"),(235, 2924, 'Entrada p/ industrialização por conta e ordem do adquirente da mercadoria, quando esta não transitar pelo estabelecimento do adquirente', 'Classificam-se neste código as entradas de insumos recebidos para serem industrializados por conta e ordem do adquirente, nas hipóteses em que os insumos não tenham transitado pelo estabelecimento do adquirente dos mesmos.', "2000-01-01T00:00:01.0000000"),(236, 2925, 'Retorno de mercadoria remetida p/ industrialização por conta e ordem do adquirente da mercadoria, quando esta não transitar pelo estabelecimento do adquirente', 'Classificam-se neste código o retorno dos insumos remetidos por conta e ordem do adquirente, para industrialização e incorporados ao produto final pelo estabelecimento industrializador, nas hipóteses em que os insumos não tenham transitado pelo estab', "2000-01-01