, cuja entrada tenha sido classificada como Compra de combustível ou lubrificante para comercialização.(a partir 01.01.2004 - Decreto Nº 26.174 de 26/11/2003)', "2000-01-01T00:00:01.0000000"),(525, 6662, 'Devolução de compra de combustível ou lubrificante adquiridos por consumidor ou usuário final', 'Devolução de compra de combustível ou lubrificante, adquiridos para consumo em processo de industrialização de outro produto, na prestação de serviço ou por usuário final, cuja entrada tenha sido classificada como Compra de combustível ou lubrifican', "2000-01-01T00:00:01.0000000"),(526, 6663, 'Remessa p/ armazenagem de combustível ou lubrificante', 'Remessa para armazenagem de combustível ou lubrificante. (a partir 01.01.2004 - Decreto Nº 26.174 de 26/11/2003)', "2000-01-01T00:00:01.0000000"),(527, 6664, 'Retorno de combustível ou lubrificante recebidos p/ armazenagem', 'Remessa, em devolução, de combustível ou lubrificante, recebidos para armazenagem.(a partir 01.01.2004 - Decreto Nº 26.174 de 26/11/2003)', "2000-01-01T00:00:01.0000000"),(528, 6665, 'Retorno simbólico de combustível ou lubrificante recebidos p/ armazenagem', 'Retorno simbólico de combustível ou lubrificante, recebidos para armazenagem, quando a mercadoria armazenada tenha sido objeto de saída, a qualquer título, e não deva retornar ao estabelecimento depositante. (a partir 01.01.2004 - Decreto Nº 26.174 d', "2000-01-01T00:00:01.0000000"),(529, 6666, 'Remessa, por conta e ordem de terceiros, de combustível ou lubrificante recebidos p/ armazenagem', 'Saída, por conta e ordem de terceiros, de combustível ou lubrificante, recebidos anteriormente para armazenagem. (a partir 01.01.2004 - Decreto Nº 26.174 de 26/11/2003)', "2000-01-01T00:00:01.0000000"),(530, 6667, 'Venda de combustível ou lubrificante a consumidor ou usuário final estabelecido em outra UF diferente da que ocorrer o consumo', 'Venda de combustível ou lubrificante a consumidor ou a usuário final, cujo abastecimento tenha sido efetuado em Unid