ercantil ou industrial.', "2000-01-01T00:00:01.0000000"),(548, 6918, 'Devolução de mercadoria recebida em consignação mercantil ou industrial', 'Classificam-se neste código as devoluções de mercadorias recebidas anteriormente a título de consignação mercantil ou industrial.', "2000-01-01T00:00:01.0000000"),(549, 6919, 'Devolução simbólica de mercadoria vendida ou utilizada em processo industrial, recebida anteriormente em consignação mercantil ou industrial', 'Classificam-se neste código as devoluções simbólicas de mercadorias vendidas ou utilizadas em processo industrial, que tenham sido recebidas anteriormente a título de consignação mercantil ou industrial.', "2000-01-01T00:00:01.0000000"),(550, 6920, 'Remessa de vasilhame ou sacaria', 'Classificam-se neste código as remessas de vasilhame ou sacaria.', "2000-01-01T00:00:01.0000000"),(551, 6921, 'Devolução de vasilhame ou sacaria', 'Classificam-se neste código as saídas por devolução de vasilhame ou sacaria.', "2000-01-01T00:00:01.0000000"),(552, 6922, 'Lançamento efetuado a título de simples faturamento decorrente de venda p/ entrega futura', 'Classificam-se neste código os registros efetuados a título de simples faturamento decorrente de venda para entrega futura.', "2000-01-01T00:00:01.0000000"),(553, 6923, 'Remessa de mercadoria por conta e ordem de terceiros, em venda à ordem ou em operações com armazém geral ou depósito fechado', 'Classificam-se neste código as saídas correspondentes à entrega de mercadorias por conta e ordem de terceiros, em vendas à ordem, cuja venda ao adquirente originário foi classificada nos códigos 6.118 - Venda de produção do estabelecimento entregue ', "2000-01-01T00:00:01.0000000"),(554, 6924, 'Remessa p/ industrialização por conta e ordem do adquirente da mercadoria, quando esta não transitar pelo estabelecimento do adquirente', 'Classificam-se neste código as saídas de insumos com destino a estabelecimento industrializador, para serem industrializados por conta e ordem do adquire