iros para industrialização ou comercialização, armazenadas em depósito fechado, armazém geral ou outro, que não tenham sido objeto de qualquer processo industrial no', "2000-01-01T00:00:01.0000000"),(566, 7127, 'Venda de produção do estabelecimento sob o regime de drawback', 'Classificam-se neste código as vendas de produtos industrializados no estabelecimento sob o regime de drawback , cujas compras foram classificadas no código 3.127 - Compra para industrialização sob o regime de drawback.', "2000-01-01T00:00:01.0000000"),(567, 7129, 'Venda de produção do estabelecimento ao mercado externo de mercadoria industrializada sob o amparo do Regime Aduaneiro Especial de Entreposto Industrial (Recof-Sped)', 'Classificam-se neste código as vendas de produtos industrializados pelo próprio estabelecimento sob amparo do Regime Aduaneiro Especial de Entreposto Industrial sob Controle Informatizado do Sistema Público de Escrituração Digital (Recof-Sped). (AJUS', "2000-01-01T00:00:01.0000000"),(568, 7201, 'Devolução de compra p/ industrialização ou produção rural', 'Devolução de mercadoria adquirida para ser utilizada em processo de industrialização ou produção rural, cuja entrada tenha sido classificada como 1.101 - Compra para industrialização ou produção rural.', "2000-01-01T00:00:01.0000000"),(569, 7202, 'Devolução de compra p/ comercialização', 'Classificam-se neste código as devoluções de mercadorias adquiridas para serem comercializadas, cujas entradas tenham sido classificadas como Compra para comercialização.', "2000-01-01T00:00:01.0000000"),(570, 7205, 'Anulação de valor relativo à aquisição de serviço de comunicação', 'Classificam-se neste código as anulações correspondentes a valores faturados indevidamente, decorrentes das aquisições de serviços de comunicação.', "2000-01-01T00:00:01.0000000"),(571, 7206, 'Anulação de valor relativo a aquisição de serviço de transporte', 'Classificam-se neste código as anulações correspondentes a valores faturados indevidamente, decorrentes das aquisições de serviços de transporte.', "2000-01-01T00:00:01.0000000"),(572, 7207, 'Anulação de valor relativo à compra de energia elétrica', 'Classificam-se neste código as anulações correspondentes a valores faturados indevidamente, decorrentes da compra de energia elétrica.', "2000-01-01T00:00:01.0000000"),(573, 7210, 'Devolução de compra p/ utilização na prestação de serviço', 'Classificam-se neste código as devoluções de mercadorias adquiridas para utilização na prestação de serviços, cujas entradas tenham sido classificadas nos códigos 3.126 - Compra para utilização na prestação de serviço sujeita ao ICMS” e 3.128 - Com', "2000-01-01T00:00:01.0000000"),(574, 7211, 'Devolução de compras p/ industrialização sob o regime de drawback', 'Classificam-se neste código as devoluções de mercadorias adquiridas para serem utilizadas em processo de industrialização sob o regime de drawback e não utilizadas no referido processo, cujas entradas tenham sido classificadas no código 3.127 - Compr', "2000-01-01T00:00:01.0000000"),(575, 7212, 'Devolução de compras para industrialização sob o regime de Regime Aduaneiro Especial de Entreposto Industrial (Recof-Sped)', 'Classificam-se neste código as devoluções de mercadorias adquiridas para serem utilizadas em processo de industrialização sob o Regime Aduaneiro Especial de Entreposto Industrial sob Controle Informatizado do Sistema Público de Escrituração Digital (', "2000-01-01T00:00:01.0000000"),(576, 7251, 'Venda de energia elétrica p/ o exterior', 'Classificam-se neste código as vendas de energia elétrica para o exterior.', "2000-01-01T00:00:01.0000000"),(577, 7301, 'Prestação de serviço de comunicação p/ execução de serviço da mesma natureza', 'Classificam-se neste código as prestações de serviços de comunicação destinados às prestações de serviços da mesma natureza.', "2000-01-01T00:00:01.0000000"),(578, 7358, 'Prestação de serviço de transporte', 'Classificam-se neste código as prestações de serviços de transpor